import {BsCodeSlash} from 'react-icons/'
 function Skills() {
  return (
    <div>
        <h2>Skills</h2>
      <li>HTML</li>
      <li>CSS</li>
      <li>Javascript</li>
      <li>React</li>
      <li>Github</li>
      <li>jQuery</li>
      <li>MySQL</li>
      <li>Bootstrap</li>
      <li>Git</li>
      <li>Node</li>
      <li>php</li>
    </div>
  );
}
export default Skills;
